// src/Dashboard.js
import React from "react";
import { Link, useLocation } from "react-router-dom";
import "./dashmain.css";

export default function DashboardMain() {
  const location = useLocation();

  return (
    <div className="dashboard-container">
      {/* Sidebar */}
      <div className="sidebar">
        <h2 className="logo">AwaInspires</h2>
        <ul className="menu">
          <li className={location.pathname === "/add-products" ? "active" : ""}>
            <Link to="/transport11/src/component/ProductForm.jsx">Add Products</Link>
          </li>
          <li className={location.pathname === "/list-products" ? "active" : ""}>
            <Link to="/transport11/src/component/ProductList.jsx">List Of Products</Link>
          </li>
          <li className={location.pathname === "/order-history" ? "active" : ""}>
            <Link to="/order-history">Order History</Link>
          </li>
          <li className={location.pathname === "/querys" ? "active" : ""}>
            <Link to="/querys">Querys</Link>
          </li>
        </ul>
      </div>

      {/* Main content rendered by React Router is handled in App.js */}
      {/* This file just handles sidebar layout */}
    </div>
  );
}
